import React from 'react'
import "./Login.css"
const Login = () => {
  return (
    <div className='login'>
      <input type="text" className='inputBox' placeholder='Enter Email'/>
      <input type="passowrd" className='inputBox' placeholder='Enter password '/>
    </div>
  )
}

export default Login
